from __future__ import absolute_import
from __future__ import division
from __future__ import print_function

import os
import urllib

import tensorflow as tf
import numpy as np

LYRICS_TRAINING = "lyrics_train.csv"

LYRICS_TEST = "lyrics_test.csv"

# Load datasets: LYRICS_TRAIN
training_set = tf.contrib.learn.datasets.base.load_csv_with_header(
  filename=LYRICS_TRAINING,
  target_dtype=np.int,
  features_dtype=np.float32)

test_set = tf.contrib.learn.datasets.base.load_csv_with_header(
  filename=LYRICS_TEST,
  target_dtype=np.int,
  features_dtype=np.float32,
  target_column=0)

  # Specify that all features have real-value data
feature_columns = [tf.contrib.layers.real_valued_column("", dimension=4817)]

  # Build 3 layer DNN with 10, 20, 10 units respectively.
classifier = tf.contrib.learn.DNNClassifier(feature_columns=feature_columns,
                                              hidden_units=[4817],
                                              n_classes=2,
                                              model_dir="/tmp/lyrics_model")
# Define the training inputs
def get_train_inputs():
	x = tf.constant(training_set.data)
	y = tf.constant(training_set.target)
	return x, y

# Fit model.
print("Successful import.")
print("------")
print("Starting model fitting!")
#classifier.fit(input_fn=get_train_inputs, steps=20)

NUM_ITER = 48
NUM_PER_ITER = 100

for i in range(NUM_ITER):
	print("------")
	classifier.fit(input_fn=get_train_inputs, steps=NUM_PER_ITER)
	print("Done with iteration #" + str(i + 1) + 
		" of " + str(NUM_ITER) + " | step " + str((i + 1) * NUM_PER_ITER) +
		" of " + str((NUM_ITER * NUM_PER_ITER)))

print("------")
classifier.fit(input_fn=get_train_inputs, steps=16)

print("Done model fitting!")
print("------")

# Define the test inputs
def get_test_inputs():
	x = tf.constant(test_set.data)
	y = tf.constant(test_set.target)

	return x, y

# Evaluate accuracy.
accuracy_score = classifier.evaluate(input_fn=get_test_inputs,
	steps=1)["accuracy"]

print("\nTest Accuracy: {0:f}\n".format(accuracy_score))

